import React, { FC } from "react"
import { 
    ImageSlideshowMainDiv,
    SlideshowHeader
 } from "./ImageSlideshowStyles";

const ImageSlideshow:FC = ():JSX.Element => {
    return (
        <ImageSlideshowMainDiv>
            <SlideshowHeader>Slideshow</SlideshowHeader>
        </ImageSlideshowMainDiv>
    )
}

export default ImageSlideshow;
